It would be impossible for words to truly express my gratitude for the East Orange New Jersey School District and community. The love and appreciation I felt deeply blessed me, and it was an honor to be used by the Most High to help young men understand the process of breaking free from emotional incarceration. 

@Superintendent.Hasan leads by example — his unrelenting energy, zeal and passion for our children is refreshing! @Mayor.TedGreen is not only committed to the emotional well-being of East Orange New Jersey youth, but also faithfully teaches martial arts and mentors youth EVERY Tuesday and Thursday at his Dojo.

Last but not least, thank you Brandon Frame of @TheUrbanAssembly for “connecting the dots!” Your dedication to ensuring that students nationwide are equipped with Social & Emotional Learning (SEL) skills is commendable.
